INSERT INTO `warnings` VALUES (1,2,0,84,'wef',1,1340562155,1340598155,2,0,'Bad user, should be banned.','Eternity inc now has new Fluxbb 1.5 forums developed and maintained by stevetheipad.\n\nIf you have any questions or concerns about them, please post them here. :)','Subject: You have received a warning\n\nMessage:\n\nDear stevetheipad\n\nYou have received a warning from the Eternity Incurakai Forums staff for \"wef\".\n\n--\nYou must stop! <b>BB</b> \n--\n\nYou can view the details of your warnings by going to [url]http://forums.eternityinc-official.com/warnings.php?view=2[/url]'),(2,28,0,1064,'Spam',3,1341436621,1342300621,2,0,'Looks like spam, but may be just an accident, though.','d','Subject: You have received a warning.\n\nMessage:\n\nDear ilackoriginality,\n\nYou have received a warning from the Eternity Incurakai Forums staff for \"Spam\".\n\nMessage:\nHey, ilackoriginality, I saw a post by you with simply the message \"d\". Was this spam or was it an accident.\nIf it was an accident, I will be happy to remove this warning from your record and am sorry for the mistake.\n\nThanks,\n-Steve\n\n\nYou can view the details of your warnings by going to [url]http://forums.eternityinc-official.com/warnings.php?view=28[/url]');
